import React from 'react';
import Navbar from './components/Navbar';
import SearchBar from './components/SearchBar';
import SearchResults from './components/SearchResults';


function App() {
  return (
    <div className="App">
      <Navbar />
      <div className="main">
        <SearchBar />
        <SearchResults />
      </div>
    </div>
  );
}

export default App;
